  return (        
    <>
      <Banner />
      <div className="aboutpage">
      <div id = "contact" class="container">
           <div class="row text-center">
               <div class="col-lg-4"><i class="bi bi-telephone" style={{padding: 10}}></i><a href="tel:+18254490084">+18254490084</a></div>
               <div class="col-lg-4"><i class="bi bi-envelope" style={{padding: 10}}></i><a href="mailto:farmingtonapp@gmail.com">farmingtonapp@gmail.com</a></div>
               <div class="col-lg-4"><i class="bi bi-house-fill" style={{padding: 10}}></i>15, Leora Court, RichmondHill, ON</div>
           </div>
       </div>
      </div>
    </>
  )
}
